import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';


const DriverAgent = () => {

  const [values, setValues] = useState({});

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setValues({ ...values, [name]: value });
  }

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");
  const [status, setStatus] = useState("");
  //const navigate = useNavigate();
  // useEffect(() => {
  //   const auth = localStorage.getItem('user');
  //   if (auth) {
  //     navigate('/')
  //   }
  // }, [])


  const collectData = async () => {
    //return console.log(JSON.stringify({username,password,role,status}));

    console.warn(email, password, role, status);
    let result = await fetch("http://localhost:5000/register", {
      method: "post",
      body: JSON.stringify({ email, password, role, status }),
      headers: {
        'content-type': 'application/json'
      }
    });

    result = await result.json();
    console.warn(result);
    console.log(result);
    localStorage.setItem("user", JSON.stringify(result))
    // navigate('/Login')


  }


  return (
    <div className='DriverAgent'>
        <div className='row'>
            <div className='col-md-3'></div>

            <div className=' col-md-12'>
                <div className='DriverAgent-form'>
                    <div className='card'>
                        <div className='card-header'>
                            <h3>Registration</h3>
                        </div>
                        <div className='card-body'>
                            <div className='row'>
                                <div className='col-md-6'>
                                    <input
                                        type='text'
                                        placeholder='fist_name'
                                        className='txtfname'
                                        title='Enter FristName'
                                        onChange={onChangeHandler}
                                        value={values.firstname}
                                    />
                                </div>

                                <div className='col-md-6'>
                                    <input
                                        type='text'
                                        placeholder='Enter Lastname'
                                        className='txtlname'
                                        title='Enter Lastname'
                                        onChange={onChangeHandler}
                                        value={values.lastname}
                                    />
                                </div>
                            </div>

                            <div className='row mt-3'>
                                <div className='col-md-5 textareaAddress' >
                                    <textarea
                                        type='textarea'
                                        cols={101}
                                        rows={4}
                                        placeholder='Enter Address'
                                        className='txtaddress'
                                        onChange={onChangeHandler}
                                        value={values.address}
                                    />
                                </div>
                            </div>

                            <div className='row mt-3'>
                                <div className='col-md-4'>
                                    <input
                                        type='email'
                                        placeholder='Enter Email'
                                        className='txtemail'
                                        title='Enter Email'
                                        onChange={onChangeHandler}
                                        value={values.email}
                                    />
                                </div>

                                <div className='col-md-4'>
                                    <input
                                        type='number'
                                        placeholder='Enter Contactno'
                                        className='txtcontactno'
                                        title='Enter Contactno'
                                        maxLength={10}
                                        onChange={onChangeHandler}
                                        value={values.contactno}
                                    />

                                  
                                </div>

                                <div className='col-md-4'>
                                    <input
                                        id='dateid'
                                        type='date'
                                        className='txtdob'
                                        onChange={onChangeHandler}
                                        value={values.dob}
                                    />
                                </div>
                            </div>

                            <div className='row mt-3'>
                                <div className='col-md-6'>
                                    <input
                                        type='text'
                                        placeholder='Enter Alternate Contact Name'
                                        className='txtalternatename'
                                        onChange={onChangeHandler}
                                        value={values.alternate_contact_name}
                                        title='Enter Alternate Contact Name'
                                        required
                                    />
                                </div>

                                <div className='col-md-6'>
                                    <input
                                        type='number'
                                        placeholder='Enter Alternate Contactno'
                                        className='txtalternatecontactno'
                                        onChange={onChangeHandler}
                                        value={values.alternate_contact_contactno}
                                      />
                                </div>
                            </div>

                            <div className='row mt-3'>
                                <div className='col-md-6'>

                                    {
                                        params.id ? 
                                        <>
                                        
                                            <input
                                                type='text'
                                                placeholder='Enter Username'
                                                className='txtusername'
                                                title='Enter Username'
                                                onChange={onChangeHandler}
                                                value={values.username}
                                            />
                                        </>:
                                        <>
                                            <input
                                                type='text'
                                                placeholder='Enter Username'
                                                className='txtusername'
                                                title='Enter Username'
                                                onChange={onChangeHandler}
                                                value={values.username}
                                            
                                            />
                                        </>
                                        }
                                </div>

                                <div className='col-md-6'>

                                    {
                                        params.id ?
                                        <>
                                            <input
                                                type='password'
                                                placeholder='Enter Password'
                                                className='txtpwd'
                                                title='Enter Password'
                                                onChange={onChangeHandler}
                                                value={values.password}
                                                disabled={true}
                                            />
                                        </>:
                                        <>
                                        
                                            <input
                                                type='password'
                                                placeholder='Enter Password'
                                                className='txtpwd'
                                                title='Enter Password'
                                                onChange={onChangeHandler}
                                                value={values.password}
                                                value={password}
                                            />
                                        </>
                                    }

                                </div>
                            </div>

                            <div className='row mt-3'>
                                <div className='col-md-12'>
                                    <select
                                        className='ddlrole'
                                        value={role}
                                    >
                                        <option value={""}>
                                            ----Select Role----
                                        </option>
                                        <option value={'librarian'}>
                                            librarian
                                        </option>
                                        <option value={'student'}>
                                            student
                                        </option>

                                        <option value={'faculty'}>
                                            faculty
                                        </option>
                                    </select>
                                </div>
                            </div>

                            <div className='mt-4'>
                                <center>
                                    <button
                                        type='button'
                                        className='btn btn-primary'
                                    >
                                        Add
                                    </button>
                                </center>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <div className='col-md-1'></div>
        </div>
    </div>
  );

}

export default DriverAgent;
